		SELECT 0 as codigo, 'El mail ya existe' mensaje;
        LEAVE PROC;
	END IF;

    START TRANSACTION;
		SET uIdUsuario = 1 + (SELECT COALESCE(MAX(idUsuario),0) FROM usuarios);
		INSERT INTO usuarios VALUES (uIdUsuario,uMail,uUsuario,MD5(uContrasenia),uNombre,uApellido,uInstitucion,uGrado,uResidencia,'usuario','A',CURRENT_TIMESTAMP,CURRENT_TIMESTAMP,uProfileImg,0);
    SELECT uIdUsuario AS codigo, 'Usuario creado exitosamente' mensaje;
    COMMIT;
END ;;
